import React from "react";
import defaultImage from "../../resources/images/defaultProfile.png";
const User = () => {
  return (
    <div className="container-fluid">
      <div className="row">
        <div className="col-md-9 border border-primary">user preference</div>
        <div className="col-md-3 border border-primary">
          <div class="row-cols-md-3">
            <div class="col">
              <img src={defaultImage} alt={defaultImage} />
            </div>

            <div class="col">Column</div>
            <div class="col">Column</div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default User;
